// AdminDashboard.jsx
import React, { useState } from 'react';
import AdminSidebar from '../components/adminsidebar';
import UsersManagement from '../components/usersmanagement';
import LocationRequests from '../components/locationrequests';
import LocationsManagement from '../components/locationsmanagement';
import './admindashboard.css';
//import AddLocationModal from './components/addlocationmodal.jsx';
const AdminDashboard = () => {
  const [activeSection, setActiveSection] = useState('requests');
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const renderContent = () => {
    switch(activeSection) {
      case 'requests':
        return <LocationRequests />;
      case 'locations':
        return <LocationsManagement />;
      case 'users':
        return <UsersManagement />;
      default:
        return <LocationRequests />;
    }
  };

  return (
    <div className="admin-dashboard">
      <AdminSidebar 
        activeSection={activeSection}
        setActiveSection={setActiveSection}
        isSidebarOpen={isSidebarOpen}
        setIsSidebarOpen={setIsSidebarOpen}
      />
      
      <div className="admin-main">
        <div className="admin-header">
          <button 
            className="sidebar-toggle"
            onClick={() => setIsSidebarOpen(!isSidebarOpen)}
          >
            <svg width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
              <line x1="3" y1="12" x2="21" y2="12"></line>
              <line x1="3" y1="6" x2="21" y2="6"></line>
              <line x1="3" y1="18" x2="21" y2="18"></line>
            </svg>
          </button>
          <h1>Panel de Administraci√≥n</h1>
        </div>

        <div className="admin-content">
          {renderContent()}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
